import React from 'react';

const NoteDetails = (props) => {
    return (
        <>
            <h3>#{props.id + 1}</h3>
            <h4>{props.titleValue}</h4>
            <p>{props.contentValue}</p>
        </>
    );
}

export default NoteDetails;
